MPH_VALt match_uniprop( const unsigned char * const key, const U16 key_len ) {
    const unsigned char * ptr= key;
    const unsigned char * ptr_end= key+key_len;
    U32 h= MPH_SEED1 + key_len;
    U32 s;
    U32 n;
    do {
        h  = (h ^ *ptr) * MPH_FNV_CONST;
    } while ( ++ptr < ptr_end );
    n= h % MPH_BUCKETS;
    s = mph_keywords[n].seed2;
    if (s) {
        h= (h >> MPH_RSHIFT) ^ s;
        n = h % MPH_BUCKETS;
        if (
            ( mph_keywords[n].pfx_len + mph_keywords[n].sfx_len == key_len ) &&
            ( memcmp(uniprops_blob + mph_keywords[n].pfx, key, mph_keywords[n].pfx_len) == 0 ) &&
            ( !mph_keywords[n].sfx_len || memcmp(uniprops_blob + mph_keywords[n].sfx,
                key + mph_keywords[n].pfx_len, mph_keywords[n].sfx_len) == 0 )
        ) {
            return mph_keywords[n].value;
        }
    }
    return 0;
}

